import React from "react";

import { Routes, Route } from "react-router-dom";
import { createTheme, ThemeProvider } from "@mui/material";
import pages from "../Pages/index";

const routes = [
  {
    path: "/",
    page: pages.intro(),
  },
  {
    path: "/contact",
    page: pages.contact(),
  },
  {
    path: "/financial_information",
    page: pages.financial(),
  },
  {
    path: "/business_information",
    page: pages.business(),
  },
  {
    path: "/policies",
    page: pages.policies(),
  },
  {
    path: "*",
    page: pages.intro(),
  },
];

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Routes>
          {routes.map((route) => (
            <Route path={route.path} element={route.page}></Route>
          ))}
        </Routes>
      </div>
    </ThemeProvider>
  );
}
const theme = createTheme({});

export default App;
